import axios from 'axios';

const http = axios.create({
    baseURL: "http://localhost:8080"
  });

  export default {

    randomBoard() {
      return http.get('/random');
    },

    multiGuessComparator(guesses, answers) {
      return http.get('', guesses, ans)
    }
}
